import React from 'react';

function CurrentRow({currentRow}) {
  return <div className="currentrow-container">
      {currentRow.map((letter) => {
            return (
                <div className="letter-box">
                    <span>{letter}</span>
                </div>
            )
        })}
  </div>;
}

export default CurrentRow;
